import React from 'react';
import { View, StyleSheet, Button, Dimensions } from 'react-native';

export const AppButton = ({ title }) => {
    return (
        <View style={styles.button}>
            <Button title={title} />
        </View>
    );
};

const styles = StyleSheet.create({
    button: {
        flex: 1,
        width: Dimensions.get('window').width - 40,
        borderRadius: 5,
    },
});
